import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  margin-top: 1rem;
  justify-content: space-between;
  width: 93%;
  align-self: center;
`;

const DetailSquare = styled.div`
  padding: 3rem 0;
  background-color: white;
  border-radius: 4px;
  box-shadow: 0 9px 28px 0 rgba(0, 0, 0, 0.03);
  background-color: #ffffff;
  flex-basis: 20%;
  display: flex;
  justify-content: center;
`;

const Text = styled.span`
text-align: center;
  font-family: PingFangSC;
  font-size: 14px;
  font-weight: normal;
  font-stretch: normal;
  font-style: normal;
  line-height: 1.57;
  letter-spacing: normal;
  color: rgba(0, 0, 0, 0.45);`;

const Dot = styled.span`
background-color: #2f9bff;
width:6px;
height:6px;
border-radius:50%;
align-self:center;
margin-right:10px


`;
const Summary = () => {
  return (
    <Container>
      <DetailSquare>
        <Dot></Dot><Text>Total</Text>
      </DetailSquare>
      <DetailSquare>Approved</DetailSquare>
      <DetailSquare>Declined</DetailSquare>
      <DetailSquare>Approval Rate</DetailSquare>
    </Container>
  );
};

export default Summary;
